/* ***********************************
Version: 74
Added by: wangxianjun
Added at: 2016-01-25 00:00:00
Description: 新增快递表和服务中心快递时间表，及新增业务中心组织机构表两个字段（是否服务中心，是否启用）
************************************ */
DROP TABLE IF EXISTS `base_deliver`;
CREATE TABLE `base_deliver` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(45) DEFAULT NULL COMMENT '快递公司名称', 
  `created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `created_by` varchar(45) NOT NULL,
  `last_updated` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `last_updated_by` varchar(45) NOT NULL,
  `is_deleted` bit(1) DEFAULT b'0' COMMENT '是否删除：0 否；1 是。',
  PRIMARY KEY (`id`)
) COMMENT='快递公司表';

DROP TABLE IF EXISTS `base_organization_deliver`;
CREATE TABLE `base_organization_deliver` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `org_id` bigint(20) NOT NULL COMMENT '服务中心id',
  `org_name` varchar(45) DEFAULT NULL COMMENT '服务中心名称',
  `deliver_id` bigint(20) NOT NULL COMMENT '快递id',
  `deliver_days` int(11) DEFAULT '0' COMMENT '快递到达天数',
  `created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `created_by` varchar(45) NOT NULL,
  `last_updated` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `last_updated_by` varchar(45) NOT NULL,
  `is_deleted` bit(1) DEFAULT b'0' COMMENT '是否删除：0 否；1 是。',
  PRIMARY KEY (`id`)
)  COMMENT='服务中心快递时间表';
ALTER TABLE `base_organization`
ADD COLUMN `is_org`  int(11) NOT NULL DEFAULT '0' COMMENT '是否服务中心：0 否；1 是。' AFTER `parent_row_id`;
ALTER TABLE `base_organization`
ADD COLUMN `enabled` int(11) NOT NULL DEFAULT '1' COMMENT '是否启用 0未启用 1启用' AFTER `is_org`;


