/* ***********************************
Version: 81
Added by: wangxianjun
Added at: 2016-01-28 00:00:00
Description: 提成报表（report_new_user_reward）线上数据修正，把多余的提成数据删除 
************************************ */
update report_new_user_reward set is_deleted = 1 where active = 0;
update report_new_user_reward set is_deleted = 1 where id not in 
(
    select a.id from 
    (
        select min(id) id, count(1) count from (select id, ifnull(add_new_buyer, add_new_seller) account, open_order_date from report_new_user_reward where active = 1 and is_deleted = 0) a where EXISTS
        (
            select 1 from (select id, ifnull(add_new_buyer, add_new_seller) account, open_order_date from report_new_user_reward where active = 1 and is_deleted = 0) b 
            where a.account=b.account group by account HAVING count(1)>1
        )
        group by account
    ) a
) and id not in
(
     select a.id from 
    (
        select min(id) id, count(1) count from (select id, ifnull(add_new_buyer, add_new_seller) account, open_order_date from report_new_user_reward where active = 1 and is_deleted = 0) a where EXISTS
        (
            select 1 from (select id, ifnull(add_new_buyer, add_new_seller) account, open_order_date from report_new_user_reward where active = 1 and is_deleted = 0) b 
            where a.account=b.account group by account HAVING count(1)=1
        )
        group by account
    ) a
) and active = 1 and is_deleted = 0;


