-- Describe: 新建服务中心提成历史表
-- Author: wangxianjun
-- Date: 2016-02-25 10:00:18
-- ----------------------------
DROP TABLE IF EXISTS `commission_excel`;
CREATE TABLE `commission_excel` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `month` varchar(10) DEFAULT NULL COMMENT '所属月份',
  `second_settlement_time` datetime DEFAULT NULL COMMENT '二结时间', 
  `buyer_org_name` varchar(45) DEFAULT NULL COMMENT '订单所属服务中心名称',
  `buyer_org_id` bigint(20) DEFAULT NULL COMMENT '订单所属服务中心id',
  `buyer_job_number` varchar(30) DEFAULT NULL COMMENT '买家交易员工号',
  `buyer_owner_name` varchar(45) DEFAULT NULL COMMENT '买家交易员姓名',
  `buyer_owner_id` bigint(20) DEFAULT NULL COMMENT '买家交易员id',
  `seller_org_name` varchar(45) DEFAULT NULL COMMENT '卖家所属服务中心名称',
  `seller_job_number` varchar(30) DEFAULT NULL COMMENT '卖家交易员工号',
  `seller_owner_name` varchar(45) DEFAULT NULL COMMENT '新开单时卖家当时所管理的交易员姓名',
  `buyer_account_name` varchar(45) DEFAULT NULL COMMENT '买家名称',
  `seller_account_name` varchar(45) DEFAULT NULL COMMENT '卖家名称',
  `cbname` varchar(45) DEFAULT NULL COMMENT '大类名称',
  `nsort_name` varchar(45) DEFAULT NULL COMMENT '品类名称',
  `material` varchar(45) DEFAULT NULL COMMENT '材质',
  `spec` varchar(45) DEFAULT NULL COMMENT '规格',
  `actual_pick_weight_server` decimal(18,6) DEFAULT NULL COMMENT '实际交易量',
  `order_code` varchar(45) DEFAULT NULL COMMENT '交易单号',
  `buyer_count` decimal(20,2) DEFAULT NULL COMMENT '新增买家提成',
  `seller_count` decimal(20,2) DEFAULT NULL COMMENT '新增卖家提成',
  `order_created` datetime DEFAULT NULL COMMENT '开单时间',
  `last_weight` decimal(18,6) DEFAULT NULL COMMENT '当月之前买家历史采购量',
  `buyer_reward_role` decimal(20,2) DEFAULT NULL COMMENT '买家提成系数（比例）',
  `seller_reward_role` decimal(20,2) DEFAULT NULL COMMENT '卖家提成系数（比例）',
  `buyer_deduct` decimal(20,2) DEFAULT NULL COMMENT '买家交易员提成金额',
  `seller_deduct` decimal(20,2) DEFAULT NULL COMMENT '卖家交易员提成金额',
  `sell_consign` varchar(45) DEFAULT NULL COMMENT '卖家类型',
  `buy_consign` varchar(45) DEFAULT NULL COMMENT '买家类型',
  `created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `created_by` varchar(45) NOT NULL DEFAULT 'system',
  `last_updated` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `last_updated_by` varchar(45) NOT NULL DEFAULT 'system',
  PRIMARY KEY (`id`)
) COMMENT='服务中心提成历史表';

