-- Describe: 新增打印凭证表 ：凭证号、类型、名称、打印次数，ip 、 凭证状态、备注、是否有效、打印时间、打印人
-- Author: wangxianjun
-- Date: 2016-04-05 09:11:18
-- ----------------------------
DROP TABLE IF EXISTS `busi_consign_order_credential`;
CREATE TABLE `busi_consign_order_credential` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `credential_code` varchar(20) NOT NULL COMMENT '凭证号',
  `type` varchar(10) DEFAULT NULL  COMMENT '凭证类型，如 buyer 买家  seller 卖家',
  `name` varchar(45) DEFAULT NULL  COMMENT '凭证名称，如 (批)收货确认函 收货确认函 (批)销售单  销售单 入库单 出库单 ',
  `print_num` int(20) NOT NULL DEFAULT '0' COMMENT '打印次数',
  `print_ip` varchar(45) DEFAULT NULL COMMENT '打印人IP',
  `status` varchar(20) NOT NULL DEFAULT 'PENDING_SUBMIT'  COMMENT '凭证状态 PENDING_SUBMIT 待提交 PENDING_APPROVAL 待审核 APPROVED 审核通过  DISAPPROVE 审核不通过',
  `note` varchar(100) DEFAULT NULL COMMENT '备注',
  `is_deleted` bit(1) DEFAULT NULL COMMENT '是否删除 0 否 1 是',
`created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '凭证生成时间',
  `print_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '打印时间',
  `printed_by` varchar(45) NOT NULL COMMENT '打印人',
  `submit_date` datetime  DEFAULT NULL  COMMENT '提交时间',
  `submited_by` varchar(45) DEFAULT NULL COMMENT '提交人',
  `audit_date` datetime DEFAULT NULL COMMENT '审核时间',
  `audit_by` varchar(45) DEFAULT NULL COMMENT '审核人',
  `row_id` varchar(45) DEFAULT NULL,
  `parent_row_id` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id`)
)COMMENT='打印凭证表';


