DROP TABLE IF EXISTS `base_organization_target_weight`;
CREATE TABLE `base_organization_target_weight` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `org_id` bigint(20) NOT NULL COMMENT '服务中心ID',
  `org_name` varchar(45) DEFAULT NULL COMMENT '服务中心名称',
  `target_weight_one` decimal(18,6) DEFAULT NULL COMMENT '目标交易量',
  `target_weight_two` decimal(18,6) DEFAULT NULL,
  `target_weight_three` decimal(18,6) DEFAULT NULL,
  `target_weight_four` decimal(18,6) DEFAULT NULL,
  `target_weight_five` decimal(18,6) DEFAULT NULL,
  `target_weight_six` decimal(18,6) DEFAULT NULL,
  `target_weight_seven` decimal(18,6) DEFAULT NULL,
  `target_weight_eight` decimal(18,6) DEFAULT NULL,
  `target_weight_nine` decimal(18,6) DEFAULT NULL,
  `target_weight_ten` decimal(18,6) DEFAULT NULL,
  `target_weight_eleven` decimal(18,6) DEFAULT NULL,
  `target_weight_twelve` decimal(18,6) DEFAULT NULL,
  `years` varchar(10) DEFAULT NULL COMMENT '年份',
  `created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `created_by` varchar(45) NOT NULL,
  `last_updated` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `last_updated_by` varchar(45) NOT NULL,
  `is_deleted` bit(1) DEFAULT b'0' COMMENT '是否删除：0 否；1 是。',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=34 DEFAULT CHARSET=utf8 COMMENT='服务中心目标交易量表';


SELECT null id,bo.id org_id,bo.name org_name,botw.target_weight_one, botw.target_weight_two, botw.target_weight_three,
          botw.target_weight_four, botw.target_weight_five, botw.target_weight_six, botw.target_weight_seven, botw.target_weight_eight,
          botw.target_weight_nine, botw.target_weight_ten, botw.target_weight_eleven, botw.target_weight_twelve,'2016' years,now() created,'cbadmin' created_by,now() last_updated,'cbadmin' last_updated_by,0 is_deleted
        FROM base_organization_target_weight botw
        RIGHT JOIN base_organization bo on bo.id=botw.org_id
        WHERE  bo.name LIKE '%服务中心' AND bo.is_org = '1' AND bo.enabled = '1';




