DROP TABLE IF EXISTS `busi_consign_order_certificate_invoice`;
CREATE TABLE `busi_consign_order_certificate_invoice` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主健ID',
  `code` varchar(45) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '交易单号',
  `type` varchar(45) NOT NULL COMMENT '卖家：seller、买家：buyer',
  `credential_code` varchar(20) DEFAULT NULL COMMENT '凭证号',
  `buyer_id` bigint(20) NOT NULL COMMENT '买家ID',
  `seller_id` bigint(20) NOT NULL COMMENT '卖家ID',
  `buyer_name` varchar(45) NOT NULL COMMENT '买家企业名称',
  `seller_name` varchar(45) NOT NULL COMMENT '卖家名称',
  `owner_id` bigint(20) NOT NULL COMMENT '交易员ID',
  `owner_name` varchar(45) NOT NULL COMMENT '交易员姓名',
  `quantity` int(11) DEFAULT NULL COMMENT '数量 件数',
  `total_weight` decimal(18,6) DEFAULT NULL COMMENT '总重量（吨）',
  `actual_pick_total_weight` decimal(18,6) DEFAULT NULL COMMENT '实提总重量（吨）',
  `total_amount` decimal(18,6) DEFAULT NULL COMMENT '总金额',
  `actual_pick_total_amount` decimal(18,6) DEFAULT NULL COMMENT '实提总金额',
  `status` varchar(20) NOT NULL DEFAULT 'PENDING_SUBMIT' COMMENT '凭证状态 PENDING_SUBMIT 待提交 PENDING_APPROVAL 待审核 APPROVED 审核通过  DISAPPROVE 审核不通过',
  `open_order_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '开单时间',
  `print_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '打印时间',
  `created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `created_by` varchar(45) NOT NULL,
  `last_updated` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `last_updated_by` varchar(45) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=107 DEFAULT CHARSET=utf8;


